// HasInstance applies the HasEdge predicate on the "instance" edge.
func HasInstance() predicate.BronzeGCPSpannerDatabase {
	return predicate.BronzeGCPSpannerDatabase(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, InstanceTable, InstanceColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPSpannerInstance
		step.Edge.Schema = schemaConfig.BronzeGCPSpannerDatabase
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasInstanceWith applies the HasEdge predicate on the "instance" edge with a given conditions (other predicates).
func HasInstanceWith(preds ...predicate.BronzeGCPSpannerInstance) predicate.BronzeGCPSpannerDatabase {
	return predicate.BronzeGCPSpannerDatabase(func(s *sql.Selector) {
		step := newInstanceStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPSpannerInstance
		step.Edge.Schema = schemaConfig.BronzeGCPSpannerDatabase
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

